import React, { Component } from "react";
import { Link } from "react-router-dom";
import AddMovie from "./AddMovie";
import AddMovieDataset from "./AddMovieDataset";

export default class AddMovieOption extends Component {
  render() {
    return (
      <div id="form">
        <Link to={"/AddMovie"}>Add one movie</Link>
        <Link to={"/AddMovieDataset"}>Add movie dataset</Link>
      </div>
    );
  }
}
